const countdowntimeStyle = theme => ({
    paper: {
       marginTop: "1rem",
       marginBottom: "1rem",
       [theme.breakpoints.up("sm")]: {
           alignSelf: "center"
       }
    },
    overrides: {
        MuiInputBase: {
            root: {
                [theme.breakpoints.up("sm")]: {
                    fontSize: "2rem"
                }
            }
        }
    }
});

export default countdowntimeStyle;

